import React from 'react';
import './Style.css';

const Home = () => {
    return (
        <div className="container"> {/* Added a container div */}
            <section id="home" className="page">
                <h3>Welcome to Our Solutions</h3>
                <p>Explore our cutting-edge microservice and nanoservice architectures for IoT, Edge, and Cloud systems.</p>
            </section>
            <footer className="footer-text"> 
                &copy; {new Date().getFullYear()}
            </footer>
        </div>
    );
};

export default Home;
